  private int countKeys(Class<?> type) throws Exception {
    byte[] prefix = db.getTypeInfo(type).keyPrefix();
    int count = 0;

    try (RocksIterator it = db.db().newIterator()) {
      it.seek(prefix);

      while (it.isValid()) {
        byte[] key = it.key();
        if (RocksDBIterator.startsWith(key, prefix)) {
